class Solution {
    public int minimumOperations(String num) {
        int len = num.length();
        int minOps = len; // Start with a max possible value considering the deletion of all digits except one or zero to make it special

        // Check for each pair if it forms a special number when ending with it
        // Special numbers end with 00, 25, 50, 75
        int[][] pairs = {{0, 0}, {2, 5}, {5, 0}, {7, 5}};
        for (int[] pair : pairs) {
            int first = -1, second = -1; // Positions of the digits forming the pair
            for (int i = len - 1; i >= 0; i--) { // Start from the end to minimize deletions
                int digit = num.charAt(i) - '0';
                if (second == -1 && digit == pair[1]) {
                    second = i;
                } else if (second != -1 && first == -1 && digit == pair[0]) {
                    first = i;
                    break; // Found both, no need to continue
                }
            }
            if (second != -1) { // Possible to form a special number
                // Calculate operations needed: delete digits after second and between first and second, if first is found
                int ops = (first == -1 ? len - 1 : len - 1 - second + second - first - 1);
                minOps = Math.min(minOps, ops);
            }
        }

        return minOps == len ? 1 : minOps; // If no change, it means the input is "0" or cannot form 25, 50, 75, or 00 without being left with a single digit
    }
}
